<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Jiotv Web IND</title>
    <style>
        body {
            font-family: Arial, sans-serif;
            background-color: #222;
            color: #fff;
            padding: 20px;
        }
        .header-section {
            display: flex;
            flex-direction: column;
            align-items: center;
            margin-bottom: 20px;
        }
        h1 {
            margin-bottom: 10px;
        }
        #search-box {
            width: 100%;
            max-width: 400px;
            padding: 10px;
            border-radius: 5px;
            border: 1px solid #555;
            background-color: #444;
            color: #fff;
            font-size: 1em;
            box-sizing: border-box;
        }
        .channels-grid {
            display: grid;
            grid-template-columns: repeat(auto-fill, minmax(150px, 1fr));
            gap: 20px;
            max-width: 1200px;
            margin: auto;
        }
        .channel-card {
            background-color: #333;
            border-radius: 8px;
            overflow: hidden;
            text-align: center;
            padding: 15px;
            transition: transform 0.2s ease, box-shadow 0.2s ease;
            cursor: pointer;
        }
        .channel-card:hover {
            transform: translateY(-5px);
            box-shadow: 0 5px 15px rgba(0, 0, 0, 0.4);
        }
        .channel-logo {
            width: 80px;
            height: 80px;
            object-fit: contain;
            border-radius: 50%;
            border: 2px solid #555;
        }
        .channel-name {
            font-size: 1em;
            margin-top: 10px;
            word-wrap: break-word; /* Allows long names to wrap to the next line */
            white-space: normal; /* Restores default white-space behavior */
        }
        a {
            text-decoration: none;
            color: inherit;
        }
    </style>
</head>
<body>
    <div class="header-section">
        <h1>Jiotv Live Channels</h1>
        <input type="text" id="search-box" placeholder="Search channels...">
    </div>

    <div id="channels-container" class="channels-grid">
        <p id="loading-message">Loading channels...</p>
    </div>
